# Функция для получения обучающей/проверочной выборки
def get_train_test(split_ratio=0.9, random_state=42, colab=False):
  labels, indices, _ = get_labels(DATA_PATH)

  if colab:
    X = np.load('/content/Music.npy')
  else:
    X = np.load('/content/drive/MyDrive/Numpy/Music.npy')
  y = np.zeros(X.shape[0], dtype='int32')

  for i, label in enumerate(labels[1:]):
    if colab:
      x = np.load(label + '.npy')
    else:
      x = np.load('/content/drive/MyDrive/Numpy/' + label + '.npy')

    X = np.vstack((X, x))
    y = np.append(y, np.full(x.shape[0], fill_value= (i + 1)))
  
  return train_test_split(X, y, test_size=(1-split_ratio), random_state=random_state, shuffle=True)

